Бобырь Юрий Иванович
Знание ин. языков: Иностранные языки не представляет&nbsp;
Хобби: Парашютный спорт, тренажерный зал, фитнес, спорт (лыжи, плаванье), музыка.&nbsp;
Навыки: инструктор по обучению шоферов транспортных средств&nbsp;
Монтаж и техобслуживание охранно-пожарной сигнализации и механического пожаротушения в заводских условиях.&nbsp;
Монтаж систем и техобслуживание систем видео исследования.&nbsp;
